export default function PaletteNavbar() {
    const [anchorEl, setAnchorEl] = React.useState(null);
  
    function handleClick(event) {
      setAnchorEl(event.currentTarget);
    }
  
    function handleClose() {
      setAnchorEl(null);
    }
  
    return (
      <div>
        <Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
          Format
        </Button>
        <Menu
          id="simple-menu"
          anchorEl={anchorEl}
          keepMounted
          open={Boolean(anchorEl)}
          onClose={handleClose}
        >
          <MenuItem onClick={handleClose}>HEX</MenuItem>
          <MenuItem onClick={handleClose}>RGB</MenuItem>
          <MenuItem onClick={handleClose}>RGBA</MenuItem>
        </Menu>
      </div>
    );
  }
